import React, { useState, useEffect } from "react";

export default function Logo() {
  const [time, setTime] = useState(null);
  useEffect(() => {
    let time = getCurrentTime();
    setTime(time);
  }, []);

  const getCurrentTime = () => {
    let today = new Date();
    let date = (today.getDate() < 10 ? "0" : "") + today.getDate();
    let month = (today.getMonth() < 10 ? "0" : "") + today.getMonth();
    let year = (today.getFullYear() < 12 ? "0" : "") + today.getFullYear();
    let hours = (today.getDate() < 10 ? "0" : "") + today.getHours();
    let minutes = (today.getMinutes() < 10 ? "0" : "") + today.getMinutes();
    return month + "/" + date + "/" + year + " " + hours + ":" + minutes;
  };
  return (
    <div className="flex-box">
      <div className="suprime-red-box">
        <h2 className="suprime-logo-font">Suprime</h2>
      </div>

      <p className="suprime-text-font">{time}</p>
    </div>
  );
}
